"use strict";$(document).ready((function(){function formatOption(option){if(!option.id)return option.text;const imageUrl=$(option.element).data("image"),$option=$(`<span>\n                <img src="${imageUrl}" style="width: 40px; height: 40px; margin-right: 5px;" />\n                ${option.text}\n            </span>`);return $option}$(".imageStyle").select2({templateResult:formatOption,templateSelection:formatOption})}));